import base64
from typing import List

# BOF imports
from core.gunnershell.bofs.base import Bof, register

from colorama import Style, Fore
brightgreen = "\001" + Style.BRIGHT + Fore.GREEN + "\002"
brightyellow = "\001" + Style.BRIGHT + Fore.YELLOW + "\002"
reset = Style.RESET_ALL

@register("hashdump")
class HashDumpBof(Bof):
	base64bof: str = ""
	x86base64bof: str = ""

	def help_menu():
		menu = """
hashdump — Dump Local SAM Hashes
================================

Extract NTLM password hashes from the local SAM database using the SYSTEM hive
for decryption. Outputs username:Rid:NTLM-hash format.

USAGE
  bofexec hashdump

WHAT IT CHECKS
  Reads from:
    - HKLM\\SAM (Security Accounts Manager hive)
    - HKLM\\SYSTEM (Boot Key for decryption)

  Dumps:
    - Local user accounts
    - RID values
    - NTLM password hashes (16-byte, hex format)

  Notes:
    - Passwords are never cracked; only raw NTLM hashes are returned.
    - Runs entirely in-process; no external binaries or PowerShell.
    - Avoids temporary files by parsing registry hives in memory.

REQUIREMENTS
  - Windows Vista / Server 2008 or later (_WIN32_WINNT >= 0x0600)
  - Administrator privileges required (SAM hive read access)

TROUBLESHOOTING
  - “Access denied reading SAM hive.”
      You must be running as SYSTEM or with SeBackupPrivilege enabled.
  - “Boot Key decryption failed.”
      SYSTEM hive may be corrupted, inaccessible, or not from same machine.
"""
		print(brightgreen + menu + reset)
		return